// import React, { useState, useEffect } from 'react';
import { toast } from "react-toastify";

toast.configure({
	autoClose: 2000,
	draggable: false,
	limit: 3,
});

export default function Popup(props) {
    const { onSelect } = props;

    const handleChange = () => {
        onSelect();
        toast.success("done");
    }

    return (
        <div>
            <button className="nav-item" onClick={() => handleChange()}>
                Hi, my name is Long
            </button>
        </div>
    );
}
